import './App.css';
import Main from './MainContent/Main';
import Navbar from './Navbar/Navbar';
import Skills from './Skills-Component/Skills';
import About from './About-component/About';
import Education from './Education-component/Education';
import Portfolio from './Portfolio-component/Portfolio';
import Contact from './footer/contact';
import Certification from './Certification/Certification';
import { Route, Routes } from 'react-router-dom';

const App = () => {
  return (
    <div className="App">
      <div className='App-Header'>
        <Navbar />
          <Routes>
            <Route path='/' element={About}/>
            <Route path='/' element={Portfolio}/>
            <Route path='/' element={Certification}/>
            <Route path='/' element={Contact}/>

          </Routes>
        <Main />
      </div>
      {/* <About /> */}
      <Skills />
      <Education />
      <Certification />
      <Portfolio />
      <Contact />
    </div>
  );
}

export default App;
